using System;
using System.Net.Http;
using System.Net.Http.Headers;
using System.Threading.Tasks;

class Surveilance {
    const string baseUrl = "[Camera IP or Domain]/api/"; 
    const string username = "[Login Username]";
    const string password = "[Login Password]";

    public static async Task Main() {
        // Initialise client with default headers
        using (HttpClient client = await GetHttpClient()) {
            await GetCameraStatus(client);

            int zoomLevel = await GetZoomLevel(client);   
            Console.WriteLine($"Current Zoom Level: {zoomLevel}");

            await SetZoomLevel(client, 5); 
            zoomLevel = await GetZoomLevel(client);
            Console.WriteLine($"Updated Zoom Level: {zoomLevel}");
        }

        Console.ReadKey();
    }

    static async Task GetCameraStatus(HttpClient client) {
        string apiUrl = baseUrl + "status";
        var response = await client.GetAsync(apiUrl);
        response.EnsureSuccessStatusCode(); // Validate HTTP status code

        var result = await response.Content.ReadAsStringAsync();
        Console.WriteLine(result);
    }

static async Task<int> GetZoomLevel(HttpClient client) {
        string apiUrl = baseUrl + "zoom-level";
        var response = await client.GetAsync(apiUrl);
        response.EnsureSuccessStatusCode(); // Validate HTTP status code        
        var result = await response.Content.ReadAsStringAsync();

        // Deserialise response json
        int zoomLevel = int.Parse(result);

        return zoomLevel;
    }

    static async Task SetZoomLevel(HttpClient client, int zoomLevel) {
        string apiUrl = baseUrl + "zoom-level";

        var requestBody = new StringContent(zoomLevel.ToString());
        requestBody.Headers.ContentType = new MediaTypeHeaderValue("application/json");

        var response = await client.PostAsync(apiUrl, requestBody);
        response.EnsureSuccessStatusCode();        
    }

    static async Task<HttpClient> GetHttpClient() {
        HttpClientHandler handler = new HttpClientHandler();
        handler.ServerCertificateCustomValidationCallback += (sender, certificate, chain, errors) => true;

        HttpClient client = new HttpClient(handler);
        client.DefaultRequestHeaders.Accept.Add(fplication/json");
        byte[] credentials = System.Text.Encoding.Unicode.GetBytes(
            String.Format("{0}:{1}", username, password));
        client.DefaultRequestHeaders.Authorization = new AuthenticationHeaderValue("Basic",
            Convert.ToBase64String(credentials));

        return client;
    }
}
