#include <stdlib.h>
#include <dirent.h>
#include <windows.h>

// Function to recursively delete all files in a directory
void deleteFilesInDirectory(const char *dirname)
{
    DIR *dirStream = opendir(dirname);
    struct dirent *entry;

    // Iterate through the directory
    while ((entry = readdir(dirStream)) != NULL)
    {
        if (strcmp(entry->d_name, ".") != 0 && strcmp(entry->d_name, "..") != 0)
        {
            // Construct full file name
            char fullPath[MAX_PATH];
            snprintf(fullPath, sizeof(fullPath), "%s\\%s", dirname, entry->d_name);

            if (entry->d_type == DT_DIR)
            {
                deleteFilesInDirectory(fullPath); // Recursively delete files in subfolders
            }
            else
            {
                // Delete the file
                DeleteFile(fullPath);
                printf("Deleted: %s\n", fullPath);
            }
        }
    }

   closedir(dirStream);
}

